import React from 'react';
import ReactDOM from 'react-dom';
import LifeCircle from './LifeCircle'
import Home from './pages/Home'

class App extends React.Component{
  render(){
    return(
      <div>
        <Home />
        <LifeCircle />
      </div>
    )
  }
}

ReactDOM.render(<App />,document.getElementById('root'));
